import React, { useState } from 'react';
import { Container, TextField, Button, MenuItem, Select, InputLabel, FormControl, Typography, Paper, Box } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#f06292',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#fce4ec',
    },
  },
  typography: {
    fontFamily: 'Comic Sans MS, sans-serif',
  },
});

const Form = () => {
  const [phoneNumber, setPhoneNumber] = useState('');
  const [personality, setPersonality] = useState('');

  const handlePhoneNumberChange = (e) => {
    setPhoneNumber(e.target.value);
  };

  const handlePersonalityChange = (e) => {
    setPersonality(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log('Phone Number:', phoneNumber);
    console.log('Personality:', personality);
  };

  return (

      <Container maxWidth="sm" sx={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        <Paper elevation={3} sx={{ p: 4, backgroundColor: '#ffffffcc' }}>
          <Typography variant="h4" component="h1" color="primary" align="center" gutterBottom>
            Personalization Form
          </Typography>
          <form onSubmit={handleSubmit}>
            <Box mb={2}>
              <TextField
                label="Phone Number"
                variant="outlined"
                fullWidth
                value={phoneNumber}
                onChange={handlePhoneNumberChange}
                sx={{ mb: 2 }}
              />
            </Box>
            <Box mb={2}>
              <FormControl fullWidth>
                <InputLabel>Personality Type</InputLabel>
                <Select
                  value={personality}
                  onChange={handlePersonalityChange}
                  label="Personality Type"
                >
                  <MenuItem value="" disabled>Select your personality</MenuItem>
                  <MenuItem value="friendly">Friendly</MenuItem>
                  <MenuItem value="professional">Professional</MenuItem>
                  <MenuItem value="funny">Funny</MenuItem>
                  <MenuItem value="serious">Serious</MenuItem>
                </Select>
              </FormControl>
            </Box>
            <Box display="flex" justifyContent="center">
              <Button type="submit" variant="contained" color="primary" sx={{ px: 4 }}>
                Submit
              </Button>
            </Box>
          </form>
        </Paper>
      </Container>
  );
};

export default Form;
